import React from "react";
import styled from "styled-components";
import { Note } from "./Note.js";
import { colors } from "./../colors.js";

export const Cell = (props) => {
  console.log(props.props.notes);
  return (
    <StyledDiv className={props.set ? "set" : ""}>
      {props.val != 0 ? (
        <div>{props.val}</div>
      ) : (
        <Notes>
          <Note num={1} show={props.notes[0]} />
          <Note num={2} show={props.notes[1]} />
          <Note num={3} show={props.notes[2]} />
          <Note num={4} show={props.notes[3]} />
          <Note num={5} show={props.notes[4]} />
          <Note num={6} show={props.notes[5]} />
          <Note num={7} show={props.notes[6]} />
          <Note num={8} show={props.notes[7]} />
          <Note num={9} show={props.notes[8]} />
        </Notes>
      )}
    </StyledDiv>
  );
};

// Cell.defaultProps = {
//   val: 0,
//   set: false,
//   notes: [],
// };

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  border: 1px solid ${colors.sudokuBorder};
  color: ${colors.sudokuFG};

  &.set {
    background-color: ${colors.sudokuSet};
  }
`;

const Notes = styled.div`
  display: grid;
  grid-template-rows: repeat(3, 1fr);
  grid-template-columns: repeat(3, 1fr);
  height: 100%;
  width: 100%;
`;
